script: |
  super -f text -I q3450.spq | sort > q3450.out

inputs:
  - name: q3450.spq
    data: |
      SELECT DISTINCT - - 14 + + col1 AS col0 FROM tab0 (FORMAT parquet) WHERE + - ( col1 ) NOT BETWEEN + - 94 * + - col1 AND + - col1;
  - name: tab0

outputs:
  - name: q3450.out
    data: |
      15
      35
      95
